  TResult maybeMap<TResult extends Object?>({
    TResult Function(BuildingStateLoaded value)? loaded,
    TResult Function(BuildingStateLoading value)? loading,
    TResult Function(BuildingStateError value)? error,
    TResult Function(BuildingStateEndedSession value)? endedSession,
    required TResult orElse(),
  }) {
    if (endedSession != null) {
